import React from 'react';
import FormIcon from '../assets/images/dynamic_form-white-48dp.svg';
import DashIcon from '../assets/images/dashboard-white-48dp.svg';
import Col from 'react-bootstrap/Col';

const SideBar = () => {
    const position:'position' = 'position'
    const sideBarStyle = {
        top: 0,
        left: 0,
        width: '5rem',
        height: '100vh',
        backgroundColor: 'gray'
    }

    return (
        <div className="Side-bar" style={sideBarStyle}>
            <div className="Side-bar-icon"><img src={FormIcon}></img></div>
            <div className="Side-bar-icon"><img src={DashIcon}></img></div>
        </div>
    )
}

export default SideBar;
